import React from "react";

class BackNext extends React.Component {
render() {
    return (
        <div>
        <button className="w-16 bg-white mx-10">Back</button>
        <button className="w-16 bg-white mx-10">Next</button>
      </div>
    );
  }
}
export default BackNext;
